		"WeekView.html": "<ExtContainer padding=\"10\" layout=\"fit\" fitToParent=\"true\">\r\n    <ExtPanel\r\n        [shadow]=\"true\"\r\n        [title]=\"panelTitle\"\r\n        [layout]=\"'hbox'\"\r\n        [header]=\"{\r\n            layout: 'hbox',\r\n            items: [\r\n                {\r\n                    xtype: 'component',\r\n                    flex: 1\r\n                },\r\n                {\r\n                    xtype: 'segmentedbutton',\r\n                    items: [\r\n                        {\r\n                            text: isPhone ? null : 'Full Week',\r\n                            iconCls: isPhone\r\n                                ? 'x-fa fa-calendar-check-o'\r\n                                : null,\r\n                            value: 'fullweek',\r\n                            handler: changeCalendarView\r\n                        },\r\n                        {\r\n                            text: isPhone ? null : 'Work Week',\r\n                            iconCls: isPhone ? 'x-fa fa-briefcase' : null,\r\n                            value: 'workweek',\r\n                            handler: changeCalendarView\r\n                        }\r\n                    ]\r\n                }\r\n            ]\r\n        }\"\r\n    >\r\n        <ExtPanel\r\n            [title]=\"'Calendars'\"\r\n            [ui]=\"'light'\"\r\n            [width]=\"150\"\r\n            [bodyPadding]=\"5\"\r\n            [hidden]=\"isPhone\"\r\n        >\r\n            <ExtCalendar_list [store]=\"this.store\"></ExtCalendar_list>\r\n        </ExtPanel>\r\n        <ExtCalendar_week\r\n            [store]=\"this.store\"\r\n            [flex]=\"1\"\r\n            [timezoneOffset]=\"0\"\r\n            [gestureNavigation]=\"false\"\r\n            [value]=\"calWeekValue\"\r\n            [firstDayOfWeek]=\"this.firstDayOfWeek\"\r\n            [visibleDays]=\"this.visibleDays\"\r\n        >\r\n        </ExtCalendar_week>\r\n    </ExtPanel>\r\n</ExtContainer>\r\n"
