		"BasicGaugeChart.ts": "declare var Ext: any;\r\nimport { Component } from '@angular/core';\r\nimport { createData } from './createData';\r\n\r\nExt.require([\r\n  'Ext.chart.series.Gauge'\r\n]);\r\n\r\n@Component({\r\n  selector: 'BasicGaugeChart-component',\r\n  templateUrl: './BasicGaugeChart.html',\r\n  styles: [``]\r\n})\r\nexport class BasicGaugeChartComponent {\r\n\r\n  animation = { \"easing\": \"elasticIn\", \"duration\": 1000 }\r\n\r\n  constructor() {\r\n    this.refresh();\r\n  }\r\n\r\n  store = Ext.create('Ext.data.Store', {\r\n    fields: ['id', 'g1', 'g2', 'g3', 'g4', 'g5', 'g6', 'name'],\r\n  });\r\n\r\n  refresh = () => {\r\n    this.store.loadData(createData(5));\r\n  };\r\n\r\n  isPhone: boolean = Ext.os.is.Phone;\r\n\r\n  chartRenderer = (sprite, config, rendererData, spriteIndex) => {\r\n    let surface = sprite.getParent(),\r\n      chart = rendererData.series.getChart(),\r\n      mainRect = chart.getMainRect(),\r\n      width = mainRect[2],\r\n      height = mainRect[3],\r\n      bigChart = (width >= 250 && height >= 150),\r\n      changes, fontSize;\r\n    \/\/ This renderer function draws the \"Temp.\" label in big white letters,\r\n    \/\/ the \"Cold\" label in blue, and the \"Hot\" label in red.\r\n    if (config.type == \"label\") {\r\n      changes = {\r\n        x: config.x + 10,\r\n        y: config.y + 10\r\n      };\r\n      if (spriteIndex == 3) {\r\n        Ext.apply(changes, {\r\n          fontSize: (bigChart ? 32 : 16),\r\n          strokeStyle: 'black'\r\n        });\r\n      } else {\r\n        Ext.apply(changes, {\r\n          fontSize: (bigChart ? 24 : 12)\r\n        });\r\n      }\r\n      switch (spriteIndex) {\r\n        case 1:\r\n          Ext.apply(changes, {\r\n            color: 'blue'\r\n          });\r\n          break;\r\n        case 3:\r\n          Ext.apply(changes, {\r\n            color: 'white'\r\n          });\r\n          break;\r\n        case 5:\r\n          Ext.apply(changes, {\r\n            color: 'darkred'\r\n          });\r\n          break;\r\n      }\r\n      return changes;\r\n    }\r\n  };\r\n\r\n  polarSeries1 = [{\r\n    type: 'gauge',\r\n    angleField: 'g1',\r\n    minimum: 100,\r\n    maximum: 800,\r\n    donut: 30,\r\n    colors: [\"#115fa6\", \"lightgrey\"]\r\n  }];\r\n\r\n  polarSeries2 = [{\r\n    type: 'gauge',\r\n    angleField: 'g1',\r\n    donut: 30,\r\n    value: 60,\r\n    minimum: 100,\r\n    maximum: 800,\r\n    needle: true,\r\n    needleLength: 95,\r\n    needleWidth: 8,\r\n    totalAngle: Math.PI,\r\n    label: {\r\n      fontSize: 12,\r\n      fontWeight: 'bold'\r\n    },\r\n    colors: ['maroon', 'blue', 'lightgray', 'red'],\r\n    sectors: [{\r\n      end: 300,\r\n      label: 'Cold',\r\n      color: 'dodgerblue'\r\n    }, {\r\n      end: 300,\r\n      style: {\r\n        strokeStyle: 'black',\r\n        strokeOpacity: 1,\r\n        lineWidth: 4\r\n      }\r\n    }, {\r\n      end: 600,\r\n      label: 'Temp.',\r\n      color: 'lightgray'\r\n    }, {\r\n      end: 600,\r\n      style: {\r\n        strokeStyle: 'black',\r\n        strokeOpacity: 1,\r\n        lineWidth: 4\r\n      }\r\n    }, {\r\n      end: 800,\r\n      label: 'Hot',\r\n      color: 'tomato'\r\n    }, {\r\n      start: 0,\r\n      style: {\r\n        strokeStyle: 'gray',\r\n        strokeOpacity: 1,\r\n        lineWidth: 4,\r\n        fillOpacity: 0\r\n      }\r\n    }],\r\n    renderer: this.chartRenderer\r\n  }];\r\n\r\n}",
		"createData.ts": "let seed = 1.3;\r\n\r\n\/\/ Controllable random.\r\nfunction random() {\r\n  seed *= 7.3;\r\n  seed -= Math.floor(seed);\r\n  return seed;\r\n}\r\n\r\nexport function createData(numRecords) {\r\n  let data = [],\r\n    record = {\r\n      id: 0,\r\n      g1: 700 * random() + 100,\r\n      g2: 700 * random() + 100,\r\n      g3: 700 * random() + 100,\r\n      g4: 700 * random() + 100,\r\n      g5: 700 * random() + 100,\r\n      g6: 700 * random() + 100,\r\n      name: 'A'\r\n    }, i;\r\n\r\n  data.push(record);\r\n  for (i = 1; i < numRecords; i++) {\r\n    record = {\r\n      id: i,\r\n      g1: Math.abs(record.g1 + 300 * random() - 140),\r\n      g2: Math.abs(record.g2 + 300 * random() - 140),\r\n      g3: Math.abs(record.g3 + 300 * random() - 140),\r\n      g4: Math.abs(record.g4 + 300 * random() - 140),\r\n      g5: Math.abs(record.g5 + 300 * random() - 140),\r\n      g6: Math.abs(record.g6 + 300 * random() - 140),\r\n      name: String.fromCharCode(65 + i)\r\n    };\r\n    data.push(record);\r\n  }\r\n\r\n  return data;\r\n}",
