		"BasicLine.html": "<ExtContainer [padding]=\"!isPhone ? '10': ''\" layout=\"vbox\" fitToParent=\"true\">\r\n    <ExtContainer\r\n        ><div #extitem>\r\n            <chart-toolbar [onThemeChange]=\"this.changeTheme\" [theme]=\"theme\">\r\n            </chart-toolbar></div\r\n    ></ExtContainer>\r\n\r\n    <ExtCartesian\r\n        downloadServerUrl=\"http:\/\/svg.sencha.io\"\r\n        flex=\"1\"\r\n        shadow=\"true\"\r\n        insetPadding=\"40 40 60 40\"\r\n        [store]=\"this.store\"\r\n        [theme]=\"theme\"\r\n        [series]=\"cartesianSeries\"\r\n        [axes]=\"cartesianAxes\"\r\n    >\r\n    </ExtCartesian>\r\n</ExtContainer>\r\n"
