		"CustomIcons.ts": "declare var Ext: any;\r\nimport { Component } from '@angular/core';\r\nimport { generateData } from './generateData';\r\n\r\nExt.require('Ext.chart.interactions.ItemEdit');\r\n\r\n@Component({\r\n  selector: 'CustomIcons-component',\r\n  templateUrl: './CustomIcons.html',\r\n  styles: [``]\r\n})\r\nexport class CustomIconsComponent {\r\n\r\n  constructor() {\r\n    this.refreshData();\r\n  }\r\n\r\n  store = Ext.create('Ext.data.Store', {\r\n    fields: ['id', 'g1', 'g2', 'g3', 'g4', 'g5', 'g6', 'name']\r\n  });\r\n\r\n\r\n  numRecords: number = 25;\r\n  theme: string = 'default';\r\n\r\n  refreshData = () => {\r\n    this.store.loadData(generateData(this.numRecords));\r\n  };\r\n\r\n  changeTheme = themep => {\r\n    this.theme = themep;\r\n  };\r\n\r\n  cartesianSeries = [{\r\n    type: 'scatter',\r\n    xField: 'id',\r\n    yField: 'g1',\r\n    title: 'Group 1',\r\n    highlight: true,\r\n    marker: {\r\n      type: 'path',\r\n      scale: 10,\r\n      lineWidth: 2,\r\n      path: [\r\n        ['M', 0, 1],\r\n        ['L', 1, 0],\r\n        ['L', 0, -1],\r\n        ['L', -1, 0],\r\n        ['Z']\r\n      ]\r\n    }\r\n  }, {\r\n    type: 'scatter',\r\n    xField: 'id',\r\n    yField: 'g2',\r\n    title: 'Group 2',\r\n    highlight: true,\r\n    marker: {\r\n      type: 'path',\r\n      scalingX: 0.1,\r\n      scalingY: -0.1,\r\n      path: [\r\n        ['M', 0, -145],\r\n        ['L', 48, -50],\r\n        ['L', 153, -36],\r\n        ['L', 76, 39],\r\n        ['L', 93, 143],\r\n        ['L', 0, 95],\r\n        ['L', -93, 143],\r\n        ['L', -76, 39],\r\n        ['L', -153, -36],\r\n        ['L', -48, -50],\r\n        ['Z']\r\n      ]\r\n    }\r\n  }];\r\n\r\n  isPhone: boolean = Ext.os.is.Phone;\r\n\r\n  cartesianAxes = [{\r\n    type: 'numeric',\r\n    position: 'left',\r\n    fields: ['g1', 'g2', 'g3', 'g4'],\r\n    label: {\r\n      rotate: {\r\n        degrees: -30\r\n      }\r\n    }\r\n  }, {\r\n    type: 'category',\r\n    position: 'bottom',\r\n    fields: 'id'\r\n  }];\r\n\r\n\r\n}",
		"generateData.ts": "let seed = 1.3;\r\n\r\n\/\/ Controllable random.\r\nconst random = () => {\r\n  seed *= 7.3;\r\n  seed -= Math.floor(seed);\r\n  return seed;\r\n};\r\n\r\nexport function generateData(count) {\r\n  const data = [];\r\n  let record = {\r\n    id: 0,\r\n    g1: 700 * random() + 100,\r\n    g2: 700 * random() + 100,\r\n    g3: 700 * random() + 100,\r\n    g4: 700 * random() + 100,\r\n    g5: 700 * random() + 100,\r\n    g6: 700 * random() + 100,\r\n    name: 'A'\r\n  };\r\n\r\n  data.push(record);\r\n\r\n  for (let i = 1; i < count; i++) {\r\n    record = {\r\n      id: i,\r\n      g1: Math.abs(record.g1 + 300 * random() - 140),\r\n      g2: Math.abs(record.g2 + 300 * random() - 140),\r\n      g3: Math.abs(record.g3 + 300 * random() - 140),\r\n      g4: Math.abs(record.g4 + 300 * random() - 140),\r\n      g5: Math.abs(record.g5 + 300 * random() - 140),\r\n      g6: Math.abs(record.g6 + 300 * random() - 140),\r\n      name: String.fromCharCode(65 + i)\r\n    };\r\n\r\n    data.push(record);\r\n  }\r\n\r\n  return data;\r\n}",
