		"FormLayout.html": "<ExtContainer [padding]=\"isPhone ? 20 : 30\">\r\n    <ExtPanel\r\n        [shadow]=\"true\"\r\n        [ui]=\"'instructions'\"\r\n        [margin]=\"'0 0 30 0'\"\r\n        [html]=\"'A <b>form</b> layout renders a single column of form fields, all with the same label width.\r\n        The default behavior is to size all labels to the width of the label with the longest\r\n        text, but the width of the labels can also be configured.'\"\r\n    ></ExtPanel>\r\n    <ExtContainer>\r\n        <div #extitem style=\"font-size:14px; font-family:Menlo, Courier; margin:10px 0 10px 0\">\r\n            labelTextAlign=\"left\" (default)\r\n        </div>\r\n        ></ExtContainer\r\n    >\r\n    <ExtFormpanel\r\n        [layout]=\"'form'\"\r\n        [shadow]=\"true\"\r\n        [margin]=\"'0 0 30 0'\"\r\n        [defaults]=\"{labelAlign: 'left'}\"\r\n    >\r\n        <ExtTextfield\r\n            [label]=\"'First Name'\"\r\n            [labelTextAlign]=\"'left'\"\r\n        ></ExtTextfield>\r\n        <ExtTextfield\r\n            [label]=\"'Last Name'\"\r\n            [labelTextAlign]=\"'left'\"\r\n        ></ExtTextfield>\r\n        <ExtTextfield\r\n            [label]=\"'Bank Account Number'\"\r\n            [labelTextAlign]=\"'left'\"\r\n        ></ExtTextfield>\r\n    </ExtFormpanel>\r\n    <ExtContainer>\r\n        <div #extitem style=\"font-size:14px;font-family:Menlo, Courier;margin:10px 0 10px 0\">\r\n          labelTextAlign=\"right\"\r\n        </div>\r\n    </ExtContainer>\r\n    <ExtFormpanel\r\n        [layout]=\"'form'\"\r\n        [shadow]=\"true\"\r\n        [defaults]=\"{labelAlign: 'left'}\"\r\n    >\r\n        <ExtTextfield\r\n            [label]=\"'First Name'\"\r\n            [labelTextAlign]=\"'right'\"\r\n        ></ExtTextfield>\r\n        <ExtTextfield\r\n            [label]=\"'Last Name'\"\r\n            [labelTextAlign]=\"'right'\"\r\n        ></ExtTextfield>\r\n        <ExtTextfield\r\n            [label]=\"'Title'\"\r\n            [labelTextAlign]=\"'right'\"\r\n        ></ExtTextfield>\r\n    </ExtFormpanel>\r\n</ExtContainer>\r\n\r\n<!-- const styles = {\r\nheading: {\r\nfontSize: '14px',\r\nfontFamily: 'Menlo, Courier',\r\nmargin: '10px 0 10px 0'\r\n}\r\n} -->\r\n"
