	"PagingList": {
		"PagingList.ts": "declare var Ext: any;\r\nimport {Component} from '@angular/core'\r\ndeclare var require: any;\r\nrequire('../stocks');\r\n\r\nExt.require([\r\n  'Ext.dataview.plugin.ListPaging'\r\n])\r\n\r\n@Component({\r\n  selector: 'paginglist-component',\r\n  templateUrl: \"./PagingList.html\",\r\n  styles: [``]\r\n})\r\nexport class PagingListComponent {\r\n\r\n  tpl = `<div>{name}</div>`;\r\n\r\n  store = Ext.create('Ext.data.Store', {\r\n    fields: ['name'],\r\n    autoLoad: true,\r\n    proxy: {\r\n      type: 'ajax',\r\n      url: '/KitchenSink/Company',\r\n      reader: {\r\n        type: 'json',\r\n        rootProperty: 'data',\r\n        implicitIncludes: false\r\n      },\r\n      extraParams: {\r\n        shuffle: true\r\n      }\r\n    }\r\n  });\r\n\r\n  bufferZone:any = false;\r\n  setBufferZone = (value) => {\r\n    this.bufferZone = value;\r\n    var store = this.list.getStore()\r\n    var plugin = this.list.findPlugin('listpaging');\r\n    store.removeAll();\r\n    plugin.setAutoPaging(value !== false);\r\n    plugin.setBufferZone(value || 0);\r\n    store.loadPage(1);\r\n  }\r\n\r\n  list: any;\r\n  listReady = (event) => {\r\n    this.list = event.cmp;\r\n  }\r\n\r\n  onSelect = (event) => {\r\n    console.log('onSelect')\r\n  }\r\n\r\n}\r\n",
		"PagingList.html": "<ExtContainer padding=\"10\" fitToParent=\"true\">\r\n    <ExtList\r\n        [left]=\"10\"\r\n        [top]=\"10\"\r\n        [width]=\"300\"\r\n        [height]=\"400\"\r\n        [shadow]=\"true\"\r\n        [itemTpl]=\"tpl\"\r\n        [store]=\"store\"\r\n        [plugins]=\"[{ type: 'listpaging' }]\"\r\n        (ready)=\"listReady($event)\"\r\n        (select)=\"onSelect($event)\"\r\n    >\r\n        <ExtContainer [docked]=\"'top'\">\r\n            <ExtContainer>\r\n                <span #extitem>\r\n                    <div style=\"padding: 15px;\">\r\n                        <b>Auto Paging</b>: {{ bufferZone === false ? \"OFF\" :\r\n                        \"ON (buffer zone: \" + bufferZone + \" )\" }}\r\n                    </div>\r\n                </span>\r\n            </ExtContainer>\r\n            <ExtSegmentedbutton>\r\n                <ExtButton\r\n                    text=\"Off\"\r\n                    [pressed]=\"bufferZone === false\"\r\n                    (tap)=\"setBufferZone(false)\"\r\n                    [flex]=\"1\"\r\n                ></ExtButton>\r\n                <ExtButton\r\n                    text=\"0\"\r\n                    [pressed]=\"bufferZone == 0\"\r\n                    (tap)=\"setBufferZone(0)\"\r\n                    [flex]=\"1\"\r\n                ></ExtButton>\r\n                <ExtButton\r\n                    text=\"8\"\r\n                    [pressed]=\"bufferZone == 8\"\r\n                    (tap)=\"setBufferZone(8)\"\r\n                    [flex]=\"1\"\r\n                ></ExtButton>\r\n                <ExtButton\r\n                    text=\"16\"\r\n                    [pressed]=\"bufferZone == 16\"\r\n                    (tap)=\"setBufferZone(16)\"\r\n                    [flex]=\"1\"\r\n                ></ExtButton>\r\n                <ExtButton\r\n                    text=\"32\"\r\n                    [pressed]=\"bufferZone == 32\"\r\n                    (tap)=\"setBufferZone(32)\"\r\n                    [flex]=\"1\"\r\n                ></ExtButton>\r\n            </ExtSegmentedbutton>\r\n        </ExtContainer>\r\n    </ExtList>\r\n</ExtContainer>\r\n"
	},
