		"RowDragAndDrop.html": "<ExtContainer padding=\"10\" layout=\"fit\" fitToParent=\"true\">\r\n    <ExtGrid\r\n        [store]=\"this.store\"\r\n        [layout]=\"'fit'\"\r\n        [shadow]=\"true\"\r\n        [height]=\"'100%'\"\r\n        [selectable]=\"this.selectable\"\r\n        [plugins]=\"{ gridrowdragdrop: true }\"\r\n    >\r\n        <ExtGridcolumn\r\n            text=\"Name\"\r\n            dataIndex=\"fullName\"\r\n            width=\"150\"\r\n            checked=\"true\"\r\n        >\r\n        </ExtGridcolumn>\r\n        <ExtGridcolumn\r\n            text=\"Email\"\r\n            dataIndex=\"email\"\r\n            [flex]=\"1\"\r\n            [sortable]=\"true\"\r\n            checked=\"true\"\r\n        >\r\n        </ExtGridcolumn>\r\n    </ExtGrid>\r\n</ExtContainer>\r\n"
