		"RangeEditorPlugin.html": "<ExtContainer layout=\"fit\" padding=\"10\" fitToParent=\"true\">\r\n    <ExtToolbar\r\n        docked=\"top\"\r\n        ui=\"app-transparent-toolbar\"\r\n        padding=\"5 8\"\r\n        [shadow]=\"false\"\r\n        [defaults]=\"{\r\n            margin: '0 10 0 0',\r\n            shadow: true,\r\n            ui: 'action'\r\n        }\"\r\n    >\r\n        <ExtButton text=\"Expand All\" [handler]=\"this.expandAll\"></ExtButton>\r\n        <ExtButton text=\"Collapse All\" [handler]=\"this.collapseAll\"></ExtButton>\r\n        <ExtSpacer></ExtSpacer>\r\n        <ExtContainer layout=\"hbox\">\r\n            <span #extitem>\r\n                <div\r\n                    style=\"\r\n                        font-size: '12px';\r\n                        font-weight: 'normal';\r\n                        margin-left: '10px';\r\n                    \"\r\n                >\r\n                    Double click an amount to edit.\r\n                </div>\r\n            </span>\r\n        </ExtContainer>\r\n    </ExtToolbar>\r\n\r\n    <ExtPivotgrid\r\n        shadow=\"true\"\r\n        (ready)=\"onPivotGridRead($event)\"\r\n        [plugins]=\"[{ type: 'pivotrangeeditor' }]\"\r\n        [matrix]=\"pivotgridMatrix\"\r\n    >\r\n    </ExtPivotgrid>\r\n</ExtContainer>\r\n"
