		"EditableTree.html": "<ExtContainer padding=\"10\" layout=\"fit\" fitToParent=\"true\">\r\n    <ExtTree\r\n        [shadow]=\"true\"\r\n        [top]=\"top\"\r\n        [left]=\"left\"\r\n        [width]=\"width\"\r\n        [height]=\"height\"\r\n        [store]=\"store\"\r\n        [platformConfig]=\"{\r\n            title: 'Editable Tree',\r\n            desktop: {\r\n                plugins: {\r\n                    gridcellediting: true\r\n                }\r\n            },\r\n            '!desktop': {\r\n                plugins: {\r\n                    grideditable: true\r\n                }\r\n            }\r\n        }\"\r\n        [columns]=\"[\r\n            {\r\n                xtype: 'treecolumn',\r\n                text: 'Name',\r\n                dataIndex: 'text',\r\n                flex: 1,\r\n                editable: true\r\n            },\r\n            {\r\n                xtype: 'treecolumn',\r\n                text: 'Class Name',\r\n                dataIndex: 'className',\r\n                flex: 1,\r\n                editable: true\r\n            }\r\n        ]\"\r\n    >\r\n    </ExtTree>\r\n</ExtContainer>\r\n"
