	"HeterogeneousTree": {
		"HeterogeneousTree.ts": "declare var Ext: any;\r\nimport { Component } from '@angular/core';\r\nimport { cityModel } from './CityModel';\r\nimport { countryModel } from './CountryModel';\r\nimport { territoryModel } from './TerritoryModel';\r\n\r\n@Component({\r\n  selector: 'heterogeneoustree-component',\r\n  templateUrl: './HeterogeneousTree.html',\r\n  styles: [``]\r\n})\r\nexport class HeterogeneousTreeComponent {\r\n\r\n  isPhone = Ext.os.is.Phone;\r\n  top = !this.isPhone ? '10' : null\r\n  left = !this.isPhone ? '10' : null\r\n  width = !this.isPhone ? '400' : null\r\n  height = !this.isPhone ? '600' : null\r\n\r\n  cityModel: any;\r\n  countryModel: any;\r\n  territoryModel: any;\r\n\r\n  constructor() {\r\n    this.cityModel = cityModel\r\n    this.countryModel = countryModel\r\n    this.territoryModel = territoryModel\r\n  }\r\n\r\n  textField : any;\r\n  onTextFieldReady = (event) => {\r\n    this.textField = event.cmp;\r\n  }\r\n\r\n  buttonField : any;\r\n  onButtonReady = (event) => {\r\n    this.buttonField = event.cmp;\r\n  }\r\n\r\n  treeField:any;\r\n  onTreeReady = (event) => {\r\n    this.treeField = event.cmp;\r\n  }\r\n\r\n  store = Ext.create('Ext.data.TreeStore', {\r\n    proxy: {\r\n      type: 'ajax',\r\n      reader: {\r\n          type: 'json',\r\n          typeProperty: 'mtype'\r\n      },\r\n      url: '/KitchenSink/GeoData'\r\n    },\r\n    lazyFill: false,\r\n    rootVisible: false\r\n  });\r\n\r\n  addItem = (event) => {\r\n    var tree = this.treeField;\r\n    var target = tree.getSelections()[0] || this.store.getRoot();\r\n    var node: any;\r\n\r\n    var value = this.textField.getValue()\r\n    if (value != null && value != '') {\r\n      if (this.store.getNodeById(value)) {\r\n        return Ext.Msg.alert('Error', 'A node with this name already exists.');\r\n      }\r\n      node = {name : value};\r\n      if (target.isRoot()) {\r\n        \/\/Nothing selected -- adding new Territory\r\n        node.children = [];\r\n        node.mtype = 'Territory';\r\n      } else if (target instanceof this.territoryModel) {\r\n        \/\/ Programatically added - must not try to load over Ajax\r\n        node.children = [];\r\n        node.mtype = 'Country';\r\n      } else if (target instanceof this.countryModel) {\r\n        \/\/ Adding to the Country level - that is our leaf level\r\n        node.leaf = true;\r\n        node.mtype = 'City';\r\n      }\r\n      node = target.appendChild(node);\r\n      if (!target.isExpanded()) {\r\n        target.expand(false);\r\n      }\r\n      tree.select(node);\r\n      this.textField.reset();\r\n    }\r\n    else {\r\n      Ext.Msg.alert('Enter a Value', 'Please Enter a Value');\r\n    }\r\n  };\r\n\r\n  onFieldAction = (event) => {\r\n    if (event.e.ENTER === event.e.getKey()) {\r\n      this.addItem(event);\r\n    }\r\n  };\r\n\r\n  onSelectionChange = (event) => {\r\n    var button = this.buttonField,\r\n        selectedNode;\r\n    var selection = event.selected\r\n    if (selection.length) {\r\n      selectedNode = selection[0];\r\n\r\n      if (selectedNode instanceof this.territoryModel) {\r\n          button.setText('Add Country');\r\n          button.enable();\r\n      } else if (selectedNode instanceof this.countryModel) {\r\n          button.setText('Add City');\r\n          button.enable();\r\n      } else {\r\n          button.disable();\r\n      }\r\n    } else {\r\n      button.setText('Add Territory');\r\n      button.enable();\r\n    }\r\n  };\r\n\r\n}",
		"CityModel.ts": "declare var Ext: any;\r\n\r\nexport const cityModel = Ext.define('KitchenSink.model.tree.City', {\r\n  extend: 'Ext.data.TreeModel',\r\n  entityName: 'City',\r\n  idProperty: 'name',\r\n  glyph: 'xf19c@FontAwesome',\r\n  fields: [{\r\n      name: 'name',\r\n      convert: undefined\r\n  },{\r\n      name: 'iconCls',\r\n      defaultValue: 'x-fa fa-bank'\r\n  }]\r\n}); \r\n",
		"CountryModel.ts": "declare var Ext: any;\r\n\r\nexport const countryModel = Ext.define('KitchenSink.model.tree.Country', {\r\n  extend: 'Ext.data.TreeModel',\r\n  entityName: 'Country',\r\n  idProperty: 'name',\r\n  glyph: 'xf024@FontAwesome',\r\n  fields: [{\r\n      name: 'name',\r\n      convert: undefined\r\n  },{\r\n      name: 'iconCls',\r\n      defaultValue: 'x-fa fa-flag'\r\n  }]\r\n})\r\n",
		"TerritoryModel.ts": "declare var Ext: any;\r\n\r\nexport const territoryModel = Ext.define('KitchenSink.model.tree.Territory', {\r\n  extend: 'Ext.data.TreeModel',\r\n  entityName: 'Territory',\r\n  idProperty: 'name',\r\n  glyph: 'xf0ac@FontAwesome',\r\n  fields: [{\r\n      name: 'name',\r\n      convert: undefined\r\n  },{\r\n      name: 'iconCls',\r\n      defaultValue: 'x-fa fa-globe'\r\n  }]\r\n});",
		"HeterogeneousTree.html": "<ExtContainer padding=\"10px\" layout=\"fit\" fitToParent=\"true\">\r\n    <ExtTree\r\n        [shadow]=\"true\"\r\n        [top]=\"top\"\r\n        [left]=\"left\"\r\n        [width]=\"width\"\r\n        [height]=\"height\"\r\n        rootVisible=\"false\"\r\n        [store]=\"this.store\"\r\n        (select)=\"this.onSelectionChange($event)\"\r\n        (selectionchange)=\"this.onSelectionChange($event)\"\r\n        [columns]=\"[\r\n            {\r\n                xtype: 'treecolumn',\r\n                text: 'Name',\r\n                dataIndex: 'name',\r\n                width: '100%'\r\n            }\r\n        ]\"\r\n        (ready)=\"onTreeReady($event)\"\r\n    >\r\n        <ExtToolbar docked=\"bottom\">\r\n            <ExtTextfield\r\n                (action)=\"this.onFieldAction($event)\"\r\n                (ready)=\"onTextFieldReady($event)\"\r\n            >\r\n            </ExtTextfield>\r\n            <ExtButton\r\n                text=\"Add Territory\"\r\n                (tap)=\"this.addItem($event)\"\r\n                (ready)=\"onButtonReady($event)\"\r\n            >\r\n            </ExtButton>\r\n        </ExtToolbar>\r\n    </ExtTree>\r\n</ExtContainer>\r\n"
	},
